import React from "react";

const TodoApp = () => {
  return (
    <div style={{ height: 1000, width: 1500, backgroundColor: "red" }}>
      <div style={{ height: 200, width: 400, backgroundColor: "green" }}>
        <p>Hello World</p>
      </div>
    </div>
  );
};

export default TodoApp;
